window.bookSummaryJSON = "<p><b>I warned her. I told her there’s no line I won’t cross to keep her.</b></p> <p>And that’s what I did, I crossed a line. Thing is, I don’t regret it. I’d do it again if I had the chance.</p> <p>This all started with me needing a wife—a wife I didn’t want.</p> <p>But things changed. She got under my skin and into my bed.</p> <p>Now, I’m not willing to let her go. Not even if she begs me to set her free.</p> <p>She knew the risk. She knew my love would come with a burden she’ll carry for the rest of her life.</p> <p>And the rest of her life is now; it’s here with me as her husband.</p> <p>Whether she spends it behind a locked door forever…that’s up to her.</p> <p><i>Unraveled</i> is the third and final book of Dark Sovereign, a dark romance series intended for mature listeners.</p>"; 
